class Solution:

    def insert_node(self, head: ListNode, val: int) -> ListNode:
        # Err1: dummy should be initialized as -inf
        dummy = ListNode(-1)
        dummy.next = head;
        prev, p = dummy, head
        while p:
            # Err2: Value can be identical to prev.val or p.val
            if prev.val < val < p.val:
                tmp = ListNode(val)
                prev.next = tmp;
                tmp.next = p
                return dummy.next;
            else:
                prev = prev.next;
                p = p.next;

        tmp = ListNode(val)
        prev.next = tmp;
        tmp.next = p
        return dummy.next


